import '../css/main.css';
import '../css/footer.css';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';

function Footer() {
  return (
    <Navbar id="footer-container" variant="dark" expand="sm" fixed="bottom">
      <Navbar.Toggle id="toggle"/>
      <Navbar.Collapse>
        <Nav>
          <Nav.Link>Lorem</Nav.Link>
          <Nav.Link>Ipsum</Nav.Link>
          <Nav.Link>Von Trap</Nav.Link>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  );
}

export default Footer;
